import React from "react";
import { NavLink } from "react-router-dom";

function Homepage() {
  return (
    <div>
      <h1>Homepage</h1>
      <p>This is the homepage page</p>
      <NavLink to="/">Landing</NavLink>
    </div>
  );
}

export default Homepage;
